Antonio Carlos Jobim. Tribute Concert - EAN: 8712177051168 - Maggiori dettagli € 14,00 Venduto e spedito da IBS 14 punti Premium Disponibile in 4 gg lavorativi Descrizione Un tributo a Tom Jobim da parte dei suoi amici, alcuni tra i migliori musicisti della scena brasiliana e jazz che si uniscono al re della bossa nova per dare nuova vita ad alcune delle sue più belle composizioni: Herbie Hancock, il sassofonista Joe Henderson con il grande pianista cubano Gonzalo Rubalcaba, Gal Costa, Shirley H
..........
ved - Shirley Horn, vocals and piano; Agua De Beber - Gonzalo Rubalcaba, piano; Olha Maria - Gonzalo Rubalcaba, piano; O Grande Amor - Joe Henderson, tenor sax, Gonzalo Rubalcaba, piano; Chega De Saudade (No More Blues) - Jon Hendricks, vocals, Herbie Hancock, piano, Ron Carter, bass; A Felicidade - Gal Costa, vocals, Herbie Hancock, piano; Se Todos Fossem Iguias A Voce - Gal Costa, vocals; Luiza - Antonio Carlos Jobim, vocals and piano; Wave - Antonio Carlos Jobim, piano, Herbie Hancock, piano;

Grammatica de su sardu Articulu in nugoresu Su sardu est una limba chi appartènet a su grùstiu noulatìnu de sas limbas indoeuropèas, faveddàda in Sardigna. Istudiosos medas la tènen in cussìderu comente sa limba romantza, de s'ala de Ponente, chi prus mantènet rapportos chin su latinu anticu. Cada sardofonu la chistiònat ind una variedade dialettale sua; b'at una tradissione chi addùrat dae unos treschèntos annos (a cumintzàre dae su piemontesu Cetti), dae parte de istudiòsos medas, de ischirrià
..........
) l'apo pessàda pro su nugoresu ca, generalmente, pacu si nde favèddat e tràttat a libellu fìntzas ispecialisticu, mancàri chi siat tenta "traditzionalmènte" a cussìderu comènte su limbàzu de su sardu chi est prus a cùrtzu a su latinu. Su logudoresu no est differente pro belle nudda dae su nugoresu, tantu chi su nugoresu si pònet belle semper in ìntro de su zàssu dialettale logudoresu: de cada manèra, b'at unu muntòne de libros chi, si cherìes, podìes recuperare. Pro su chi pertòccat su campidan
